function getElapsedTime(postDate: Date): string {
  const currentDate = new Date();
  const elapsedTime = currentDate.getTime() - postDate.getTime();

  const seconds = Math.floor((elapsedTime / 1000) % 60);
  const minutes = Math.floor((elapsedTime / (1000 * 60)) % 60);
  const hours = Math.floor((elapsedTime / (1000 * 60 * 60)) % 24);
  const days = Math.floor((elapsedTime / (1000 * 60 * 60 * 24)));

  if (days > 0) {
    return `${days} day(s) ago`;
  } else if (hours > 0) {
    return `${hours} hour(s) ago`;
  } else if (minutes > 0) {
    return `${minutes} minute(s) ago`;
  } else {
    return `${seconds} second(s) ago`;
  }
}

// Example usage:
const postDate = new Date('2022-01-01T00:00:00Z');
console.log(getElapsedTime(postDate)); // Output: 31 day(s) ago (assuming it's run on Feb 1st)

